import React from "react";
const Dashboard = React.lazy(() => import("./Components/Dashboard"));
const routes = [
  {
    path: "/home",
    name: "Home",
    component: "",
    exact: true,
  },
  {
    path: "/dashboard",
    name: "Dashboard",
    component: Dashboard,
    exact: true,
  },
  {
    path: "/inbox",
    name: "Inbox",
    component: "",
    exact: true,
  },
  {
    path: "/products",
    name: "Products",
    component: "",
    exact: true,
  },
  {
    path: "/admin",
    name: "Admin",
    component: "",
    exact: true,
  },
];

export default routes;
